export const setFavMatch = ({
  time,
  hometeam,
  awayteam,
  winner,
  homescore,
  awayscore,
  id,
}) => ({
  type: "SET_FAV_MATCH",
  payload: { id, time, hometeam, awayteam, winner, homescore, awayscore },
  id,
});

export const deleteFavMatch = ({
  time,
  hometeam,
  awayteam,
  homescore,
  awayscore,
  id,
}) => ({
  type: "DELETE_FAV_MATCH",
  payload: { id, time, hometeam, awayteam, winner, homescore, awayscore },
  id,
});
